INSERT INTO `main_notice` VALUES (1, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-05 21:14:04');
INSERT INTO `main_notice` VALUES (11, '23', '<p>we</p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"about:blank\"></iframe><p><br></p>', '系统管理员', '2020-01-03 16:50:11', '2020-01-03 16:50:11');
INSERT INTO `main_notice` VALUES (12, '文艺的话', '<p><br></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">2、花开如火，也如寂寞。——顾城</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">3、刮奖刮出一个“谢”字就可以停手了，没必</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">要非得把“谢谢惠顾”四个字都刮出来。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——网易云热评</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">4、我年青时以为金钱至上，而今年事已迈，发现果真如此。 ――王尔德</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">5、我十有八九的欲言又止，在日后想来都庆幸。而绝大多数的敞开心扉在事后都追悔。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——德卡先生的信箱</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">6、我渴望能见你一面，但请你记得，我不会开口要求要见你。这不是因为骄傲，你知道我在你面前亳无骄傲可言，而是因为，唯有你也想见我的时侯，我们见面才有意义。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">――西蒙・波伏娃《越洋情书》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">7、苏剧说，“人一生注定会遇到这样两个人，一个惊艳了你的时光，一个温暖了你的岁月”。其实应该补上后半句——有的人注定只能惊艳时光而不能温暖你的岁月。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——阑珊夜</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">10、喜欢胜过所有道理。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">原则抵不过我乐意。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——烟酒故事</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">11、所有命运赠送的礼物，早已在暗中标好了价格。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">――茨威格《断头王后》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">12、好女孩得到一个好字，坏女孩得到全世界。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《我的朋友陈白露小姐》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">13、如果我也是那冬风，知道你喜欢无叶之树，也会铆足劲在那高高的白杨树之间来来去去地刮。看见白杨树的叶子如旧掉的雪一样飘下来，看到它最终只剩干净的枝条儿在苍穹中高擎。每一天你在那树下经过，你会不知疲倦地不断仰望，那清新的自由的利落的萧条的线条，你以为是大自然不经意间起的形，不，那是我为了成就你的仰望化身成风后的精益求精。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——李大优童鞋</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">14、我曾经7次鄙视自己的灵魂。它本可以进取却故作谦卑；它在空虚时用爱欲填充；在困难和容易之间选择了容易；它犯了错，却借由别人也会犯错来宽慰自己；它自由软弱却把他认为生命的坚韧；它鄙夷一张丑恶的嘴脸，却不知那正是自己面具中的一副；它侧身于生活的污泥，虽不甘心，却又畏首畏尾。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——纪伯伦</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">15、每一次克制自己，都意味着比以前更强大。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——高尔基</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">16、上过舞台的人都知道，灯太亮，看不见台下。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——知乎答友Mimi</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">17、有的异性/同性做不成恋人，却也舍不得给别人。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——韩小萌（/同性 是我加上去的）</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">18、这世界本就没有任何一句话，可以让你醍醐灌顶。真正叫你醍醐灌顶的，只能是一段经历。而那句话，只是火药仓库内划燃的一根火柴。——《一句顶一万句》刘震云</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">19、时间美化那悸动也抚平激动。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——歌曲《红玫瑰》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">20、可是，讲不清楚为什么，你还是有所眷恋，像是一种迷信，庙宇塌毁了，神还是神。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——独木舟</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">21、人的境遇是一种筛子，筛选了落到我们视野里的人和事，人一旦掉到一种境遇里，就会变成吸铁石，把铁屑都吸到身边来</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——韩松落《鲤·旅馆》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">22、山川是不卷收的文章，日月为你掌灯伴读。——简媜</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">23、吹灭读书灯，一身都是月。——孙玉石</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">24、让懂的人懂，让不懂的人不懂，让世界是世界，我甘心是我的茧。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《美丽的茧》简帧</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">25、岁月飞跑，一把短藏刀</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">我一生的好时光引颈就屠</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——张子选《慈航》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">26、就算我一错再错一败涂地一事无成，我总会知道，那些为梦想买单的日子璀璨如星河。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——知乎答主小生</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">27、微言妙趣大则源于性情学问的融会，小则见于一字一句的选择与安排，你如果不曾身历其境，便难免忽略过去。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——朱光潜</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">28、人生最大的快慰是创造，一件难做的事做成了，一种闷在心里的情感或思想表现出来了，自己回头一看，就如同上帝创造了世界，母亲产出了婴儿，看到它好，自己也充分感觉到自己的力量，越发兴起鼓舞。没有尝到这种快慰的人就没有尝到文学的最大乐趣。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——周国平</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">29、也许你我终将行踪不明，但是你该知道我曾经为你动过情。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——波德莱尔</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">（30至47出自沃兹基硕德的《鲁迅他没说，是我说的》，嘿嘿嘿，皮一下。）</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">30、很多时候，所谓的不信，并不是真的不相信。只是，他正信着让他觉得更为可靠的另一个。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">31、不在某刻，在这一刻。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">32、空虚是有重量的，积累到一定程度后，是会把人压垮的。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">33、人生在世，想通一件事就好了，那就是很多事情其实你不需要去想通。想得通与想不通其实都无关紧要，重要的是你怎么选。我越来越相信，人生就是选择的总和。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">34、去做就是了。做了你或许会痛苦，甚至会后悔，但是你千万记住，做了绝对不会像没做那样遗憾。更何况，万一做到了呢？</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">35、知行合一做不到的话，那就先别管知不知了，去行就是了。这种莽撞，这种笨拙，不会让你后悔的。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">36、在我最无忧无虑的日子里，我总怪自己没思没想。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">37、感动之所以为感动，大体如此吧。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">我们会被长久的“等待”所感动，是因为有人做到了很难做到的事，做到了正常人权衡利弊后，根本不可能去做的事。你也同样不会，因为你明白这会很吃亏，很煎熬，很痛苦，甚至很愚蠢。所以当有这样一个人出现的时候，便会深深为之感动。人生何处不围城，一边期盼着，一边又拒斥着。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">38、我们都说着自己要找个合适的人。可是，都没有真正在一起你怎么知道合适不合适？蘑菇有没有毒，吃过才知道。螃蟹好不好吃，吃过才知道。彼此之间相互喜欢就可以了，除了这以外你还有什么好想的呢？</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">39、我不断地问为什么，尽可能把问题彻彻底底搞懂。其实我不是个爱问为什么的人，我逼着自己尽可能地找到所有“为什么”，因为我怕她问我为什么的时候，我会因没有思索过而哑口无言。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">40、久而久之，就不了了之了。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">41、抱歉，我这人确实当不了坏人，但是也不想当什么好人，别给我发卡。我不那么无私，不那么热于奉献，我的所有付出都是想要有回报的。这话我对着喇叭喊出来也不会觉得心虚惭愧，人有所求才是真常态。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">42、接受别人的好是有代价的。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">43、奇怪的是，我明明什么都没有经历过，心态却已经很苍老了。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">44、一切景语皆情语，</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">因我无情，故入眼之景皆不成语，</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">因我无语，故入眼一切皆不成景。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">45、有些美好品质是只能得其一而不能两全的。美好品质与美好品质之间并不总能和谐如一，会相互拮抗，甚至互斥。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">46、觉得怎么安排都行的人，是最好伺候，同时也最不好伺候的人。好伺候是因为他们不挑剔觉得什么都差不多都还过得去，不好伺候也是因为这个，都行都差不多意味着你很难让他们达到比较高的满意度。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">47、有些余味太深长的东西，你是无法即刻品出来的。它需要时间去沉淀，然后发酵，越是芳醇的味道越是需要酝酿，而你也需要时间去成长，才能拥有与它层次相匹的品味。</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">————呆板的分割线——————</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">（更新一波吧，嘿嘿。希望大家喜欢）</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">48、无论如何，我一定要去试试，就是不能证明我可以，那也有证明我不可以。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《流血的仕途》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">49、你问人问题，她若答非所问，便已是答了，毋需再问。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——木心</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">50、你把秘密告诉了风，风会吹遍整片森林。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《先知》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">51、自尊告诉我：“这不可能。”经验告诉我：“这有风险。”情理告诉我：“这毫无意义。”内心却轻声说：“试试看吧。”</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——网易云热评</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">52、曾经以为走不出的日子，现在都回不去了。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——村上春树</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">53、有些人能感受雨，而其他人则只是被淋湿。——罗杰·米勒</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">54、我本可以忍受黑暗，如果我不曾见过太阳。然而阳光已使我的荒凉，成为更新的荒凉。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《如果我不曾见过太阳》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">55、谈恋爱是一个失去自己再找到自己的过程。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——涂磊</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">56、你在街头遇到的每一个人，都是某个人的做梦都想遇见的人。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——网易云</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">57、先说爱的先不爱，后动心的不死心。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——网易云热评</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">58、我们成为什么人，其实都是自己默许的。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——阑珊夜</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">59、发自内心地生活的人最有魅力，每个人都是不一样的，当他/她不盲从于世俗的所谓标准，活出自己的个性的人生，他/她本身就焕发着无法比拟的人格魅力。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——网易云热评</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">60、你知道，故事的结尾并不重要，生活唯一确保我们的就是死亡。所以我们最好不要让那结尾，夺走了故事的光芒。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《漫长的告别》</strong></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">61、我们要如何度过爱的痛苦？靠硬撑。我们要如何克服无爱的痛苦？也靠硬撑。分开的痛苦，要靠硬撑，其实在一起，有时也是撑过去的。这就是生活。套用电影里的台词：“真是没有那么复杂。”</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——豆瓣</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">————阔别许久远方归来的分界线————</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">62、追二兔者不得一兔</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">63、性爱乃生之原点，命之光辉。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">64、岁月在治愈各种创伤的同时，也在日益侵蚀着人们的情感。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《复乐园》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">65、有时候一分钟里发生的巧事比整整一年的苦苦追求还管用。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">66、最纯洁的决心都会有一些庸俗可笑、但又是铁铸成的链索把它拴在这个地上，这些链索是不容易挣断的。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">67、一个人心中没有爱情的时候可以满足于虚荣，但一旦有了爱情，虚荣就变得庸俗不堪了。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《茶花女》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">68、所谓心就是这样的东西，绝对不会一视同仁，就像河流，流势会随着地形的不同而不同。</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——《世界尽头与冷酷仙境》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">69、如果你遵守了小的规则，你就能打破大的规则。——乔治·奥威尔《1984》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">70、我只希望，祈祷，我的心境不要再粗糙下去，荒芜下去，这就是我的最大愿望</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">——周作人 《不知道》</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">71、Some of us think holding on makes us strong but sometimes it is letting go. ——有的人认为坚持会让我们变得更强大，但有时候放手也会。 ​</strong></p><p class=\"ql-align-center\"><strong class=\"ql-size-large\" style=\"background-color: rgb(230, 0, 0);\">72、及时止损。</strong></p>', '系统管理员', '2020-01-03 17:26:32', '2020-01-03 17:26:32');
INSERT INTO `main_notice` VALUES (13, '喜欢的句子', '<p><br></p><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">1-“我裁一段星河以赠你，好教你不逊色这人间错落烟火。”</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">2-“照见无尽星河，邂逅日落霞光。”</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">3-“今晚月色真美，眸中所及很明朗，而你朝我走来的路途温柔了万般光景。” ​​​</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">4-“傍晚的阳光金黄而辽远，四季交替却如此温情，你迟到了许多年，可我依然为你的到来而高兴。” ​​​</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">5-“万事俱备，我只欠你。” ​​​</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">6-“我与你隔着长风深谷，近不得，退不舍。”</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">7- “站在你身畔 却像隔着银河”</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">8-“有一个单词叫BAADER-MEINHOF，这个词能够解释东京初见的烟花，华盛顿大学喷泉背后的雪山，西海岸一号公路上悬崖星空和亨利米勒，还有以往一面之缘爱过的人。 ” ​​​</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">9-“但愿我可以没成长，完全凭直觉觅对象，模糊地迷恋你一场，就当风雨下潮涨。”</span></blockquote><blockquote class=\"ql-align-center\"><span class=\"ql-size-large\">10-“这里有一颗星星，它等过春夏秋冬的流转，等过山川湖泊的晨暮，等过漫漫孤灯的长夜，它在等你，等你披星戴月载着岁月的晨光而来点亮它的世界。” </span>​​​</blockquote><p><span class=\"ql-size-large\"><img src=\"https://pic4.zhimg.com/80/v2-c52143350b5adc39b0c567eb0b5475d6_hd.jpg\" width=\"1080\"></span></p><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">11-“你是无意穿堂风，偏偏孤倨引山洪。” ​​​</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">12-“遇见你这么美好的事情，像森林听见风声，像黑夜缠绕清晨。” ​​​</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">13-“画一个恒星，再做个梦给你。” ​​​</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">14-“着迷于你眼睛，银河有迹可循，穿过时间的缝隙，它依然真实地，吸引我轨迹。等到看你银色满际，等到分不清季节更替，才敢说沉溺。”</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">15-“黄昏把它的碎片，一片片洒向人间，融入山川湖海，于是耿耿星河才有幸住进你的眼睛，我把这些碎片收集起来写成长信，赶在入夜之前轻声读给你听。”</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">16-“你踩着漫长星辰的光而来，而我在你到来的刹那便失了心智，从此山河过往，凛冬天明，你都有我。”</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">17-“不要因为怕变成一个平凡的灵魂，就逃脱剥离人间的烟火气，每个人在这光怪陆离的世界都是不同的生活方式，所以只要是自己想要的，那便是最好的人生姿态。” ​​​</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">18-\"有很多话想跟你说，但一直没有机会，我携带着它们穿越季节，掠过高架，铺在山与海之间。花盛开就是一句，夜漫过就是一篇。黄昏开始书写，黎明是无数的扉页。全世界拼成首诗，我爱你当作最后一行。”</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">19-“其实真正的送别没有长亭古道，没有劝君更尽一杯酒，就是在一个和平时一样的清晨，有的人留在昨天了。”</span></h3><h3 class=\"ql-align-center\"><span class=\"ql-size-large\">20-“我爱死了这说不清道不明的一生，我爱着人生里涌现的骄傲和低处的迷雾，我感谢我自己卑微而鲜活地存在。</span>”</h3><p><img src=\"https://pic1.zhimg.com/80/v2-2937f4e8b2696601038cf3e44f604a51_hd.jpg\" width=\"1440\"></p><h2><strong>21-“春水初生春林初盛，春风十里不如你。”</strong></h2><h2><strong>22-“在广袤的空间和无限的时间中，能够与你共享同一颗行星和同一段时光，是我的荣幸。”</strong></h2><h2><strong>23-“不管前方的路有多苦，只要走的方向正确，不管多么崎岖不平，都比站在原地更接近幸福。”</strong></h2><h2><strong>24-“春夏秋冬尽在你唇齿深渊眉宇之间，春华秋实夏蝉冬雪喜欢你年复一年。” ​​​</strong></h2><h2><strong>25-“我的生活被分割成认识你以前和以后，能停留在名为你的世界，每天醒来都有满心的喜悦。” ​​​</strong></h2><h2><strong>26-“我曾跋涉万水千山，绕过城市的霓虹，穿过街角的凉风，去找寻世间的美好，直到在一个晴好的日子遇见你，才发现你才是一切美好的总和。” ​​​</strong></h2><h2><strong>27-“陪你看四季交换，坠入洋洋洒洒天地间藏匿的星星点点，陪你看日出月落，念沉沉浮浮日子里冗杂着的事态变迁，浩瀚星辰你终是我归宿。” ​​​</strong></h2><h2><strong>28-“由于长久的等待我变成了路牌，指向希望的方向没有一字说明。”</strong></h2><h2><strong>29-“时间默默不语，但我曾与你倾述。尽管命运从未被道明，因为我对你的爱远胜言语能表白，如果我能告诉你，我一定会让你知道。”</strong></h2><h2><strong>30-“琥珀里的时间，微暗的火，一生都在半途而废，一生都怀抱热望。”</strong></h2><p><img src=\"https://pic3.zhimg.com/80/v2-80836156df4dbe21d8513227ae2a6576_hd.jpg\" width=\"1000\"></p><h2 class=\"ql-align-center\">31-“幸福： 一是睡在家的床上。二是吃父母做的饭菜。三是听爱人给你说情话。四是跟孩子做游戏。”</h2><h2 class=\"ql-align-center\">32-\" 你是我温暖的手套，冰冷的啤酒，带着阳光味道的衬衫，日复一日的梦想。\"</h2><h2 class=\"ql-align-center\">33-“水星在自己不近不远的轨迹守护太阳。而我以后也会一直在你身边熙熙攘攘的人群，不再走近，也不会远离。我会努力变得更好，希望你也是。”</h2><h2 class=\"ql-align-center\">34-“日出日落月望月朔，沉寂的繁星会在夜空泛起微光，而生活向我袭来的黑暗让我更加闪烁。” ​​​</h2><h2 class=\"ql-align-center\">35-“荒芜冬季的倦怠和晦涩会随着惊蛰而结束，迈进风光旖旎明亮利落的春季。在这季节交替中我陪你看这昼夜往复日升月落，我陪你体会寒来暑往暖风过境。” ​​​</h2><h2 class=\"ql-align-center\">36-“喜欢地球只有一个月亮，让爱的距离，浓缩成一句美丽晚安。年年有余，周周复始，也许给不了你很多感动，但我会陪你很久。” ​​​</h2><h2 class=\"ql-align-center\">37-“乘着日色苍茫在街道行走，我以为看到了你给我的阳光，可不知它泛滥的廉价而寻常，直到我们人海相望，才知从未拥有过阳光。” ​​​</h2><h2 class=\"ql-align-center\">38-“暮色偷偷降临，星星眨眨眼睛，目睹了所有的动心，宇宙星辰有趣的灵魂终会相遇。” ​​​</h2><h2 class=\"ql-align-center\">39-“人的一生要经历太多的生离死别，那些突如其来的离别往往将人伤得措手不及，人生何处不相逢，但有些转身，真的就是一生，从此后会无期，永不相见，用力爱过的人，讲再见那一刻格外艰难。世界上最遥远的距离不是生离死别，而是对方已经云淡风轻，你却念念不忘。”</h2><h2 class=\"ql-align-center\">40-“我自诩坦荡，行走人间。我思考潮汐起伏，思考林间鸟雀，思考宇宙星光，思考冷暖人间。然后你来了。你是潮汐，你是鸟雀，你是星光，你是人间。”</h2><p class=\"ql-align-center\"><img src=\"https://pic4.zhimg.com/80/v2-6032fadc3c14ed18e85bb16bdc36f861_hd.jpg\" width=\"720\"></p><h2 class=\"ql-align-center\">41-“头顶的星光经过亿万光年的跋涉也能做一次抵达，睡意又是为何在深邃的夜里不知归家。”</h2><h2 class=\"ql-align-center\">42-“气温骤降，便格外想念春天。记得初见你时，烟雨朦胧，草木生长，春意盎然。夏天最想念入夜的凉风，冬天最期盼清晨的鸟鸣。时间给予空间记忆，空间给予时间感情。你说当雪开始消融的时候归来，于是我格外期盼春天。我祈愿你更靠近我，让我的春天提前到来。才记起初见你时，腊月未到，还是深冬。”</h2><h2 class=\"ql-align-center\">43-“想住在深山里，戒不掉手机但会给重要的人用钢笔写信，给你写的信我寄到月球了，那里没有氧，我可以爱你几百年。”</h2><h2 class=\"ql-align-center\">44-“常常有人说我为爱而活，这大概是我一生中听到过的最好而又最坏的话。我爱早听钟声，倦怠了就枕书小憩。我也爱欲眠的灯市，爱你的吴侬软语。在仲秋里细数少得可怜的流年，爱过了头翻过了页就要死去。”</h2><h2 class=\"ql-align-center\">45-“晨时不言不语的你，眼睛中有潮汐的你，云霓一样，猫行阶梯一样，牵引我的心。那是人世间最美的图景，越过曙色、薄暮与星光，还在遥远的途中，我便深深期待着你。”</h2><h2 class=\"ql-align-center\">46-“从微观上讲，分子原子不停流动，世间万物各自独立又相互联系，共同构成完整的命运体。</h2><h2 class=\"ql-align-center\">建筑轮廓拦截晚霞，汹涌海浪亲吻流萤，昨天穿的牛仔裤理解西伯利亚的冷天气，咖啡杯里下过一场非洲草原的雨。阳台上的野猫学着蕨类植物舒展身体，我们的脉搏连接着宇宙的呼吸。”</h2><h2 class=\"ql-align-center\">47-“我曾有梦。关于河流，关于宇宙，关于蜻蜓或风。飞船俯冲进大熊星座，幼鲸从海面跃起，长着胡须的男人在熊熊燃烧的战壕旁读信，戴着帽子的少女在街头向猫索吻。但是这些都随着周一要交的工作报表和两张没写完的作业，稀释在空气里，蒸发在氤氲中。”</h2><h2 class=\"ql-align-center\">48-“你掀起山河奔向我，踏尽星辰来访我，而我有整个宇宙想讲给你听。张开嘴，却说不出半粒星。”</h2><h2 class=\"ql-align-center\">49-一时浪漫起，几点温暖意。宇宙星河灿，皆是深情寄。</h2><h2 class=\"ql-align-center\">50-“不过人们说，</h2><h2 class=\"ql-align-center\">我们体内每个原子，</h2><h2 class=\"ql-align-center\">曾是每个星球的一部分，</h2><h2 class=\"ql-align-center\">或许我不是离开，而是回家。”</h2><h2 class=\"ql-align-center\"><img src=\"https://pic3.zhimg.com/80/v2-7fff825dd53ae7a2d69103fa2ebaeba4_hd.jpg\" width=\"700\"></h2><h2 class=\"ql-align-center\">51-有人是你的山河</h2><h2 class=\"ql-align-center\">有人是你的星光</h2><h2 class=\"ql-align-center\">而我只做你的月亮 ​​​</h2><h2 class=\"ql-align-center\">52-“希望有一天能去看看一号公路的日落，布鲁克林大桥的人海，特洛伊的飘雪，纽约中央车站的告白。你在身边也好，不在身边也好，想站在人生遗憾的中间，再一次记住你的脸。”</h2><h2 class=\"ql-align-center\">53-“常常有人说我为爱而活，这大概是我一生中听到过的最好而又最坏的话。我爱早听钟声，倦怠了就枕书小憩。我也爱欲眠的灯市，爱你的吴侬软语。在仲秋里细数少得可怜的流年，爱过了头翻过了页就要死去。”</h2><h2 class=\"ql-align-center\">54-“我确实真诚地喜欢过你，想过带你去看每年故宫的初雪，阿拉斯加的海岸线，我曾愿意与你两人独占一江秋，愿意与你郡亭枕上看潮头，铺着红地毯的礼堂，暮霭沉沉的原野，我都曾愿与你共享，我想象过和你一起生活，直到白发苍苍垂垂老矣，同枕共穴，至死不休。 可我现在也确实不喜欢你了，车站年久失修，江南的砖瓦裂了缝，当初不撞南墙不回头的热血已然冷却。抱歉啦，我们就此别过吧，我的喜欢要给别的姑娘啦。 此生勿复见，山水不相逢。”</h2><h2 class=\"ql-align-center\">55-日语里「夏天结束了」其实和「今晚月色真美」一样，是有隐晦暗示的。代表着某天突然感知到河岸的风带来凉意，爱慕的心绪不了了之，没牵到的手，未送出的信，青春潦草收场后关上了门。就像睡了漫长的午觉醒来，穿衣洗漱准备去学校，找了半天却找不到课本和双肩包，才恍惚想起自己在多年前明明没有做好准备，就被推搡着长大成人。来不及跟夏天挥手告别的仓促人生，年轻时也对世间万物充满期待，眨眼间就落入了平庸之海。</h2><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', '系统管理员', '2020-01-03 20:16:34', '2020-01-03 20:16:34');
INSERT INTO `main_notice` VALUES (14, '喜欢的句子', '<p><br></p><p><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">1-“我裁一段星河以赠你，好教你不逊色这人间错落烟火。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">2-“照见无尽星河，邂逅日落霞光。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">3-“今晚月色真美，眸中所及很明朗，而你朝我走来的路途温柔了万般光景。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">4-“傍晚的阳光金黄而辽远，四季交替却如此温情，你迟到了许多年，可我依然为你的到来而高兴。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">5-“万事俱备，我只欠你。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">6-“我与你隔着长风深谷，近不得，退不舍。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">7- “站在你身畔 却像隔着银河”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">8-“有一个单词叫BAADER-MEINHOF，这个词能够解释东京初见的烟花，华盛顿大学喷泉背后的雪山，西海岸一号公路上悬崖星空和亨利米勒，还有以往一面之缘爱过的人。 ” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">9-“但愿我可以没成长，完全凭直觉觅对象，模糊地迷恋你一场，就当风雨下潮涨。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">10-“这里有一颗星星，它等过春夏秋冬的流转，等过山川湖泊的晨暮，等过漫漫孤灯的长夜，它在等你，等你披星戴月载着岁月的晨光而来点亮它的世界。” ​​​</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\"><img src=\"https://pic4.zhimg.com/80/v2-c52143350b5adc39b0c567eb0b5475d6_hd.jpg\" width=\"1080\"></span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">11-“你是无意穿堂风，偏偏孤倨引山洪。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">12-“遇见你这么美好的事情，像森林听见风声，像黑夜缠绕清晨。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">13-“画一个恒星，再做个梦给你。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">14-“着迷于你眼睛，银河有迹可循，穿过时间的缝隙，它依然真实地，吸引我轨迹。等到看你银色满际，等到分不清季节更替，才敢说沉溺。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">15-“黄昏把它的碎片，一片片洒向人间，融入山川湖海，于是耿耿星河才有幸住进你的眼睛，我把这些碎片收集起来写成长信，赶在入夜之前轻声读给你听。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">16-“你踩着漫长星辰的光而来，而我在你到来的刹那便失了心智，从此山河过往，凛冬天明，你都有我。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">17-“不要因为怕变成一个平凡的灵魂，就逃脱剥离人间的烟火气，每个人在这光怪陆离的世界都是不同的生活方式，所以只要是自己想要的，那便是最好的人生姿态。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">18-\"有很多话想跟你说，但一直没有机会，我携带着它们穿越季节，掠过高架，铺在山与海之间。花盛开就是一句，夜漫过就是一篇。黄昏开始书写，黎明是无数的扉页。全世界拼成首诗，我爱你当作最后一行。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">19-“其实真正的送别没有长亭古道，没有劝君更尽一杯酒，就是在一个和平时一样的清晨，有的人留在昨天了。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">20-“我爱死了这说不清道不明的一生，我爱着人生里涌现的骄傲和低处的迷雾，我感谢我自己卑微而鲜活地存在。”</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\"><img src=\"https://pic1.zhimg.com/80/v2-2937f4e8b2696601038cf3e44f604a51_hd.jpg\" width=\"1440\"></span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">21-“春水初生春林初盛，春风十里不如你。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">22-“在广袤的空间和无限的时间中，能够与你共享同一颗行星和同一段时光，是我的荣幸。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">23-“不管前方的路有多苦，只要走的方向正确，不管多么崎岖不平，都比站在原地更接近幸福。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">24-“春夏秋冬尽在你唇齿深渊眉宇之间，春华秋实夏蝉冬雪喜欢你年复一年。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">25-“我的生活被分割成认识你以前和以后，能停留在名为你的世界，每天醒来都有满心的喜悦。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">26-“我曾跋涉万水千山，绕过城市的霓虹，穿过街角的凉风，去找寻世间的美好，直到在一个晴好的日子遇见你，才发现你才是一切美好的总和。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">27-“陪你看四季交换，坠入洋洋洒洒天地间藏匿的星星点点，陪你看日出月落，念沉沉浮浮日子里冗杂着的事态变迁，浩瀚星辰你终是我归宿。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">28-“由于长久的等待我变成了路牌，指向希望的方向没有一字说明。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">29-“时间默默不语，但我曾与你倾述。尽管命运从未被道明，因为我对你的爱远胜言语能表白，如果我能告诉你，我一定会让你知道。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">30-“琥珀里的时间，微暗的火，一生都在半途而废，一生都怀抱热望。”</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">&lt;img src=\"https://pic3.zhimg.com/50/v2-80836156df4dbe21d8513227ae2a6576_hd.jpg\" data-rawwidth=\"1000\" data-rawheight=\"1584\" data-size=\"normal\" data-default-watermark-src=\"https://pic2.zhimg.com/50/v2-78ea042f4be23d868cf8dfcf38a684e8_hd.jpg\" class=\"origin_image zh-lightbox-thumb\" width=\"1000\" data-original=\"https://pic3.zhimg.com/v2-80836156df4dbe21d8513227ae2a6576_r.jpg\"/&gt;<img src=\"https://pic3.zhimg.com/80/v2-80836156df4dbe21d8513227ae2a6576_hd.jpg\" width=\"1000\"></span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">31-“幸福： 一是睡在家的床上。二是吃父母做的饭菜。三是听爱人给你说情话。四是跟孩子做游戏。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">32-\" 你是我温暖的手套，冰冷的啤酒，带着阳光味道的衬衫，日复一日的梦想。\"</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">33-“水星在自己不近不远的轨迹守护太阳。而我以后也会一直在你身边熙熙攘攘的人群，不再走近，也不会远离。我会努力变得更好，希望你也是。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">34-“日出日落月望月朔，沉寂的繁星会在夜空泛起微光，而生活向我袭来的黑暗让我更加闪烁。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">35-“荒芜冬季的倦怠和晦涩会随着惊蛰而结束，迈进风光旖旎明亮利落的春季。在这季节交替中我陪你看这昼夜往复日升月落，我陪你体会寒来暑往暖风过境。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">36-“喜欢地球只有一个月亮，让爱的距离，浓缩成一句美丽晚安。年年有余，周周复始，也许给不了你很多感动，但我会陪你很久。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">37-“乘着日色苍茫在街道行走，我以为看到了你给我的阳光，可不知它泛滥的廉价而寻常，直到我们人海相望，才知从未拥有过阳光。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">38-“暮色偷偷降临，星星眨眨眼睛，目睹了所有的动心，宇宙星辰有趣的灵魂终会相遇。” ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">39-“人的一生要经历太多的生离死别，那些突如其来的离别往往将人伤得措手不及，人生何处不相逢，但有些转身，真的就是一生，从此后会无期，永不相见，用力爱过的人，讲再见那一刻格外艰难。世界上最遥远的距离不是生离死别，而是对方已经云淡风轻，你却念念不忘。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">40-“我自诩坦荡，行走人间。我思考潮汐起伏，思考林间鸟雀，思考宇宙星光，思考冷暖人间。然后你来了。你是潮汐，你是鸟雀，你是星光，你是人间。”</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">&lt;img src=\"https://pic4.zhimg.com/50/v2-6032fadc3c14ed18e85bb16bdc36f861_hd.jpg\" data-rawwidth=\"720\" data-rawheight=\"720\" data-size=\"normal\" data-default-watermark-src=\"https://pic4.zhimg.com/50/v2-2cefbf02d07db447cd8892271ab63320_hd.jpg\" class=\"origin_image zh-lightbox-thumb\" width=\"720\" data-original=\"https://pic4.zhimg.com/v2-6032fadc3c14ed18e85bb16bdc36f861_r.jpg\"/&gt;<img src=\"https://pic4.zhimg.com/80/v2-6032fadc3c14ed18e85bb16bdc36f861_hd.jpg\" width=\"720\"></span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">41-“头顶的星光经过亿万光年的跋涉也能做一次抵达，睡意又是为何在深邃的夜里不知归家。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">42-“气温骤降，便格外想念春天。记得初见你时，烟雨朦胧，草木生长，春意盎然。夏天最想念入夜的凉风，冬天最期盼清晨的鸟鸣。时间给予空间记忆，空间给予时间感情。你说当雪开始消融的时候归来，于是我格外期盼春天。我祈愿你更靠近我，让我的春天提前到来。才记起初见你时，腊月未到，还是深冬。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">43-“想住在深山里，戒不掉手机但会给重要的人用钢笔写信，给你写的信我寄到月球了，那里没有氧，我可以爱你几百年。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">44-“常常有人说我为爱而活，这大概是我一生中听到过的最好而又最坏的话。我爱早听钟声，倦怠了就枕书小憩。我也爱欲眠的灯市，爱你的吴侬软语。在仲秋里细数少得可怜的流年，爱过了头翻过了页就要死去。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">45-“晨时不言不语的你，眼睛中有潮汐的你，云霓一样，猫行阶梯一样，牵引我的心。那是人世间最美的图景，越过曙色、薄暮与星光，还在遥远的途中，我便深深期待着你。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">46-“从微观上讲，分子原子不停流动，世间万物各自独立又相互联系，共同构成完整的命运体。</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">建筑轮廓拦截晚霞，汹涌海浪亲吻流萤，昨天穿的牛仔裤理解西伯利亚的冷天气，咖啡杯里下过一场非洲草原的雨。阳台上的野猫学着蕨类植物舒展身体，我们的脉搏连接着宇宙的呼吸。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">47-“我曾有梦。关于河流，关于宇宙，关于蜻蜓或风。飞船俯冲进大熊星座，幼鲸从海面跃起，长着胡须的男人在熊熊燃烧的战壕旁读信，戴着帽子的少女在街头向猫索吻。但是这些都随着周一要交的工作报表和两张没写完的作业，稀释在空气里，蒸发在氤氲中。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">48-“你掀起山河奔向我，踏尽星辰来访我，而我有整个宇宙想讲给你听。张开嘴，却说不出半粒星。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">49-一时浪漫起，几点温暖意。宇宙星河灿，皆是深情寄。</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">50-“不过人们说，</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">我们体内每个原子，</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">曾是每个星球的一部分，</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">或许我不是离开，而是回家。”</span></p><p class=\"ql-align-center\"><br></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">&lt;img src=\"https://pic3.zhimg.com/50/v2-7fff825dd53ae7a2d69103fa2ebaeba4_hd.jpg\" data-rawwidth=\"700\" data-rawheight=\"394\" data-size=\"normal\" data-default-watermark-src=\"https://pic3.zhimg.com/50/v2-aef9f151ee82ee335aeb39ec432c9403_hd.jpg\" class=\"origin_image zh-lightbox-thumb\" width=\"700\" data-original=\"https://pic3.zhimg.com/v2-7fff825dd53ae7a2d69103fa2ebaeba4_r.jpg\"/&gt;<img src=\"https://pic3.zhimg.com/80/v2-7fff825dd53ae7a2d69103fa2ebaeba4_hd.jpg\" width=\"700\"></span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">51-有人是你的山河</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">有人是你的星光</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">而我只做你的月亮 ​​​</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">52-“希望有一天能去看看一号公路的日落，布鲁克林大桥的人海，特洛伊的飘雪，纽约中央车站的告白。你在身边也好，不在身边也好，想站在人生遗憾的中间，再一次记住你的脸。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">53-“常常有人说我为爱而活，这大概是我一生中听到过的最好而又最坏的话。我爱早听钟声，倦怠了就枕书小憩。我也爱欲眠的灯市，爱你的吴侬软语。在仲秋里细数少得可怜的流年，爱过了头翻过了页就要死去。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">54-“我确实真诚地喜欢过你，想过带你去看每年故宫的初雪，阿拉斯加的海岸线，我曾愿意与你两人独占一江秋，愿意与你郡亭枕上看潮头，铺着红地毯的礼堂，暮霭沉沉的原野，我都曾愿与你共享，我想象过和你一起生活，直到白发苍苍垂垂老矣，同枕共穴，至死不休。 可我现在也确实不喜欢你了，车站年久失修，江南的砖瓦裂了缝，当初不撞南墙不回头的热血已然冷却。抱歉啦，我们就此别过吧，我的喜欢要给别的姑娘啦。 此生勿复见，山水不相逢。”</span></p><p class=\"ql-align-center\"><span class=\"ql-size-large\">55-日语里「夏天结束了」其实和「今晚月色真美」一样，是有隐晦暗示的。代表着某天突然感知到河岸的风带来凉意，爱慕的心绪不了了之，没牵到的手，未送出的信，青春潦草收场后关上了门。就像睡了漫长的午觉醒来，穿衣洗漱准备去学校，找了半天却找不到课本和双肩包，才恍惚想起自己在多年前明明没有做好准备，就被推搡着长大成人。来不及跟夏天挥手告别的仓促人生，年轻时也对世间万物充满期待，眨眼间就落入了平庸之海。</span></p>', '系统管理员', '2020-01-03 23:23:42', '2020-01-03 23:23:42');
