INSERT INTO `main_notice` VALUES (48, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (49, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (50, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (51, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (52, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (53, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED456C84A811E7403005074\"></p><p class=\"ql-align-justify\">13.不愿清醒，宁愿一直沉迷放纵。不知归路，宁愿一世无悔追逐。</p><p class=\"ql-align-justify\">14.一个人快乐或悲伤，只要不是装出来的，就必有其道理。你可以去分享他的快乐，同情他的悲伤，却不可以命令他怎样怎样他，因为这是违背人类的天性的。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=2482333350,2045228094&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=E4E2AEF146A7C2EE400DF87B0300E074\"></p><p class=\"ql-align-justify\">15.除了一个现实的此生之外，人们还应该拥有一个诗意的世界。</p><p class=\"ql-align-justify\">16.深思熟虑的结果往往就是说不清楚。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3614798419,2368698905&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=456&amp;s=989EF2FA4262BEEE4A85EF2603006056\"></p><p class=\"ql-align-justify\">17.假如你真正爱过书的话，你就会明白，一本在你手中待过很长时间的好书就像一张熟悉的面孔一样，永远也不会忘记。</p><p class=\"ql-align-justify\">18.你想知道我对你的爱情是什么吗？就是从心底里喜欢你，觉得你的一举一动都很亲切，不高兴你比喜欢我更喜欢别人。你要是喜欢别人我会哭，但是还是喜欢你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3818462499,2612504233&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=440&amp;s=23A0F6A75E36C6CA0287523A0300A05D\"></p><p class=\"ql-align-justify\">19.一个人倘若需要从思想中得到快乐，那么他的第一个欲望就是学习。</p><p class=\"ql-align-justify\">20.什么叫失败？也许可以说，人去做一件事情，没有达到预期的目的，这就是失败……一个常常在进行着接近自己限度的斗争的人总是会常常失败的…只有那些安于自己限度之内的生活的人才总是“胜利”。</p><p><br></p>', '系统管理员', '2020-01-03 10:45:14', '2020-01-03 10:45:14');
INSERT INTO `main_notice` VALUES (54, '王小波经典语录', '<p class=\"ql-align-justify\">1.你要是愿意，我就永远爱你你要是不愿意，我就永远相思。</p><p class=\"ql-align-justify\">2.我把我整个灵魂都给你，连同它的怪癖，耍小脾气，忽明忽暗，一千八百种坏毛病。它真讨厌，只有一点好，爱你。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3078566370,3366194196&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=411&amp;s=89B4F6B640426BEB4881826C0300B074\"></p><p class=\"ql-align-justify\">3.我认为失恋就像出麻疹，如果你不失上几次，就不会有免疫力。</p><p class=\"ql-align-justify\">4.没有人有耐心听你讲完自己的故事，因为每个人都有自己的话要说；没有人喜欢听你抱怨生活，因为每个人都有自己的苦痛；世人多半寂寞，这世界愿意倾听，习惯沉默的人，难得几个。人一切的痛苦，本质上都是对自己的无能的愤怒。</p><p><img src=\"https://ss2.baidu.com/6ONYsjip0QIZ8tyhnq/it/u=1898627918,3347832525&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=407&amp;s=908AA6F844133BCC1E85563D03001046\"></p><p class=\"ql-align-justify\">5.尊严就是你走在任何地方，都被当作一个人物而不是一个东西来看待。</p><p class=\"ql-align-justify\">6.如果一个人不会唱，那么全世界的歌对他毫无用处；如果他会唱，那他一定要唱自己的歌。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=1750836565,3365734539&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=381&amp;s=E483EAB800447EEE4AAC1D440300C0F6\"></p><p class=\"ql-align-justify\">7.这辈子我干什么都可以，就是不能做一个一无所能，就能明辨是非的人。</p><p class=\"ql-align-justify\">8.信心这个东西，什么时候都像个高楼大厦，但是里面却会长白蚁。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3472051029,2176402630&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=375&amp;s=8180A2F95852B2C816B5D20903005054\"></p><p class=\"ql-align-justify\">9.我的勇气和你的勇气加起来，对付这个世界总够了吧？去向世界发出我们的声音，我一个人是不敢的，有了你，我就敢。</p><p class=\"ql-align-justify\">10.一个人活在这世界上第一要好好做人；第二不要惯坏了别人的坏毛病。</p><p><img src=\"https://ss1.baidu.com/6ONXsjip0QIZ8tyhnq/it/u=3812949949,2018735061&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=398&amp;s=11A2F6B7FCCEB4CA0A3DE04A03007074\"></p><p class=\"ql-align-justify\">11.人和人是不平等的，其中最重要的，是人与人有知识的差异。</p><p class=\"ql-align-justify\">12.这个世界自始至终只有两种人：一种是像我这样的人，一种是不像我这样的人。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=3085719015,2569096272&amp;fm=173&amp;app=25&amp;f=JPEG?w=570&amp;h=409&amp;s=E0EAA6F15ED